import "@babel/polyfill";
import "mutationobserver-shim";
import { createApp } from "vue";
import App from "./App.vue";
import router from "./router";
import "./assets/tailwind.css";
import AOS from "aos";
import "aos/dist/aos.css";

new Vue({
  created() {
    AOS.init();
  },
  render: (h) => h(app),
})
  .use(router)
  .AOS.init()
  .mount("#app");
